import React from "react";
import "./homepage.css";
import videobg from '../../assets/react-bg.mp4'

function HomePage() {
   return (
    <div>
        <di classname="overlay">
            <video src={videobg} autoPlay loop muted />
        </di>
        <h1>Welcome to FinMap</h1>
    </div>
   )
}

export default HomePage;
